import { ListItem, Button, List, ListItemButton, ListItemText, ListSubheader, ThemeProvider, createTheme } from "@mui/material";
import React from "react";

import "./ControlPanel.css"

const theme = createTheme({

    palette: {
        primary: {
            main: '#FEB130',
        },
        secondary: {
            main: '#ff80ab',
        },
    },
})

const ControlPanel = () => {
    const Feature = ["Driving", "Tuning", "Color Selector"]
    return (
        <List className="Navigator" variant="outlined">
            {Feature.map((i) => {
                return (
                    <ListItem key={i}>
                        <ListItemButton style={{"width": "fit-content"}} color='primary' href="#simple-list" >
                            <ListItemText color="primary" primary={i} />
                        </ListItemButton>
                    </ListItem>
                )
            })}
        </List >
        // </ThemeProvider >

    );
}

export default ControlPanel
